import "./basic.css";

let BasicJsx = () => {

  let fname = "Dinga";
  let lname = "Raja";
  let num = 12;
  let multiple = num * num;
  let generateOtp = () => Math.floor(Math.random() * 9000 + 1000);

  // let b = setInterval(generateOtp, 1000);
  return (
    <>
      {/* Static Content */}
      <h1> Welcome to React class</h1>

      {/* Static with Dynamic Content */}
      <h3>
        My name is {fname} {lname}
      </h3>

      {/* Dynamic Content */}
      <h3>
        {num} * {num} = {num * num}
      </h3>
      <h3>
        {num} * {num} = {multiple}
      </h3>

      <h1 style={{ color: "red" }}>OTP :- {generateOtp()}</h1>
      <div className="hi">lore</div>
    </>
  );
};
export default BasicJsx;
